@-moz-document domain(humongous.io) {
*::-webkit-scrollbar {
    width: 10px !important;
    height: 10px !important;
    background: #1e1e1e !important;
    border: 1px solid #41454F !important;
}
*::-webkit-scrollbar-button {
    display: none !important;
}
*::-webkit-scrollbar-thumb,
*::-webkit-scrollbar-track {
    border: 0 !important;
    box-shadow: none !important;
}
*::-webkit-scrollbar-thumb {
    min-height: 28px !important;
    background: #363D47 !important;
}
*::-webkit-scrollbar-corner,
*::-webkit-scrollbar-track {
    background: #1e1e1e !important;
}
#contentbox {
    background: #14161a;
}
.tablewrapper table thead th {
    background-color: #282c34;
    border-top: 1px solid #282c34;
    color: #E3E5E8;
}
.tablewrapper table tr {
    border-bottom: 1px solid #14161a;
}
.tablewrapper table {
    color: #bec2ca;
    background: #282C34;
}
a {
    color: #61AFEF;
}

a:hover {
    color: #69bbff;
}
menu {
    background: #21252b;
}
.eldonlist {
    background: #21252b;
}
.eldonlist .listname {
    color: #E3E5E8;
}
.eldonlist.active,
.eldonlist:hover {
    background: #282C34;
}
menu .separator {
    border-color: transparent !important;
}
menu .findcollection {
    background: #21252b;
}
menu .findcollection input {
    color: #bec2ca;
}
.navbutton {
    color: #E3E5E8;
    border: 1px solid #282c34;
    background: #282c34;
}
.eldonicon {
    color: #bec2ca;
}
.hmodal .eldonmodal {
    color: #bec2ca;
    background: #282C34;
}
.eldonlabel {
    color: #737a8c;
}
.field_wrapper input, .field_wrapper input:hover, .field_wrapper input:focus, .field_wrapper select, .field_wrapper select:hover, .field_wrapper select:focus, .field_wrapper textarea {
    color: #bec2ca;
}
.eldonbtn.grey {
    background: #282C34;
    color: #E3E5E8;
}
.eldonbtn.grey:hover, .eldonbtn.grey:active, .eldonbtn.grey:focus {
    background-color: #282C34;
}
.hmodal .collectionconfig .section {
    background: #21252b;
}.hmodal .collectionconfig .section .eldonlist {
    background: #21252b;
}
.hmodal .collectionconfig .sectioncontent.viewerformconfig .menu .menuheader {
    border-bottom: 1px solid #21252b;
}
.hmodal .collectionconfig .sectioncontent.viewerformconfig .menu {
    background: #21252b;
}
.widgetstore {
    background: #21252b;
}
.widgetstore .widgets_wrapper .widgets .widget {
    background: #282C34;
}
.widgetstore .searchwidget {
    background: #282C34;
}
.widgetstore .searchwidget input {
    color: #E3E5E8;
}
input, input:hover, input:focus, select, select:hover, select:focus, textarea {
    border-bottom: 1px solid #14161a;
}
.titlebox {
    background: #282C34;
}
#header {
    background: #282C34;
}
.linkbutton.blacklinkbutton {
    color: #41454F;
}
.drop-element .drop-content .dropdowncontent {
    background: #282C34;
}
.hmodal .settings .menu .menuheader {
    border-bottom: 1px solid #21252b;
}
hmodal .settings .menu {
    background: #21252b;
}
.notifications .title {
    color: #E3E5E8;
}
.useridentity .account_username {
    color: #E3E5E8;
}
.eldonlist.bottomsticky {
    border-top: 1px solid #14161a;
}
.horizontalselect_wrapper .horizontalselect .select {
    background: #282C34;
}
.tagsviewer .tag {
    background-color: #363D47;
    color: #bec2ca;
}
input[type=checkbox], input[type=checkbox]:hover, input[type=checkbox]:focus, input[type=checkbox]:active {
    border: 1px solid #535865;
}
input[type=checkbox]:checked::after, input[type=checkbox]:hover:checked::after, input[type=checkbox]:focus:checked::after, input[type=checkbox]:active:checked::after {
    color: transparent;
}
input[type=checkbox]:checked, input[type=checkbox]:hover:checked, input[type=checkbox]:focus:checked, input[type=checkbox]:active:checked {
    border: 1px solid #E3E5E8;
    background: #E3E5E8;
}

.hmodal .settings .menu {
    background: #21252b;
}
.has-value.Select--single>.Select-control .Select-value .Select-value-label, .has-value.is-pseudo-focused.Select--single>.Select-control .Select-value .Select-value-label {
    color: #E3E5E8;
}
.projectslist, .eldonmodal.projectslist {
    background: #282C34;
}
.projectslist .team.active, .eldonmodal.projectslist .team.active {
    background: #282C34;
}
.eldonlist.whitebacklist {
    background: #282C34;
}
.eldonlist.active.blackactivelist .listname, .eldonlist:hover.blackactivelist .listname {
    color: #E3E5E8;
}
.viewerwrapper .viewer .nodata {
    background: #14161a;
    color: #7a818f;
}
.projectslist .team.active .teamheader .teamname, .eldonmodal.projectslist .team.active .teamheader .teamname {
    color: #E3E5E8;
}
.separator {
    border-top: 1px solid #424853!important;
}
}
